const Template = (props) => {
  return (
    <div>
      {props.data.map((data) => (
        <div>
          <template>
            {data.name}

            {data.firstname}

            {data.job}
            <p>{data.email}</p>
            <p>{data.phone}</p>
          </template>
        </div>
      ))}
    </div>
  );
};

export default Template;
